import React from "react";

function ConflictsColumn({ startDate, endDate }) {
  let errorMessage = "";

  if (!startDate || !endDate) {
    errorMessage = "Заполните обе даты";
  } else if (new Date(endDate) < new Date(startDate)) {
    errorMessage = "Дата окончания раньше даты начала";
  }

  return <span style={{ color: errorMessage ? "red" : "inherit" }}>{errorMessage}</span>;
}

export default ConflictsColumn;
